    [],nt"revision_timestamp": "2016-04-21T00:52:21.183014",nt"name": "us-fire-adminstration-fire-statistics",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fire Administration collects data
    from a variety of sources to provide information and analyses on the status and
    scope of the fire problem in the United States. We use these data to highlight current
    and emerging trends in fires, including what causes fires, where they occur, and
    who is impacted the most by fire. We also analyze the circumstances surrounding
    on-duty firefighter casualties to help identify approaches that can reduce the number
    of deaths and injuries in future years.",nt"license_title": "License Not Specified",nt"extras":
